INSERT INTO `train_data` VALUES (1,'tt','','','','','','','огурец','однолетнее травянистое растение, вид рода Огурец (Cucumis) семейства Тыквенные (Cucurbitaceae).','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(2,'tt','','','','','','','гриб','разговорно-обиходное название плодовых тел грибов-макромицетов. Согласно современным научным представлениям, грибы выделяются в самостоятельное царство живой природы — лат. Fungi. Грибы, образующие крупные плодовые тела относятся к подцарству высших грибов (Dikarya), в котором выделяют два отдела — аскомицеты (Ascomycota), или сумчатые грибы, и базидиомицеты (Basidiomycota). С практической точки зрения различают съедобные, несъедобные и ядовитые грибы. «Грибом» называют также студенистую массу, состоящую из различных микроорганизмов, преимущественно дрожжей (сахаромицетов) и молочнокислых бактерий, используемую для получения напитков путём сбраживания, например, чайный гриб, кефирный гриб.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(3,'tt','','','','','','','кирпич','искусственный камень правильной формы, используемый в качестве строительного материала, произведённый из минеральных материалов, обладающий свойствами камня, прочностью, водостойкостью, морозостойкостью[1].','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(4,'tt','','','','','','','пластик','органические материалы, основой которых являются синтетические или природные высокомолекулярные соединения (полимеры). Исключительно широкое применение получили пластмассы на основе синтетических полимеров.','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(5,'tt','','','','','','','лед','вода в твёрдом агрегатном состоянии.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(6,'tt','','','','','','','древесина','в обыденной жизни и технике древесиной называют внутреннюю часть дерева, лежащую под корой;\nв ботанике под древесиной, или ксилемой, подразумевают ткань или совокупность тканей, образовавшихся из прокамбия или камбия.\nСамые ранние из известных науке ископаемых древесных растений были обнаружены в 2011 году в канадской провинции Нью-Брансуик, где между 395 и 400 миллионами лет назад произрастал древний лес[1].','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(7,'tt','','','','','','','металл','группа элементов, в виде простых веществ, обладающих характерными металлическими свойствами, такими, как высокие тепло- и электропроводность, положительный температурный коэффициент сопротивления, высокая пластичность и металлический блеск.','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(8,'tt','','','','','','','пенопласт','это класс материалов, представляющий собой вспененные (ячеистые) пластические массы (Газонаполненные пластмассы).\n\nПоскольку основной объём пенопласта занимает газ, плотность пенопласта существенно ниже, чем плотность его исходного сырья (полимера). Это обусловливает сравнительно высокие теплоизоляционные (в отдельно взятой ячейке практически невозможны конвекционные потоки) и звукоизоляционные (тонкие и сравнительно эластичные перегородки ячеек — плохой проводник звуковых колебаний) свойства материалов данного класса.','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(9,'tt','','','','','','','капуста','двулетнее растение, сельскохозяйственная культура; вид рода Капуста (лат. Brassica) семейства Капустные (Крестоцветные).','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(10,'tt','','','','','','','картофель','вид многолетних клубненосных травянистых растений из рода Паслён (Solanum) семейства Паслёновые (Solanaceae). Клубни картофеля являются важным пищевым продуктом, в отличие от ядовитых плодов, содержащих гликоалкалоид соланин. Клубни картофеля имеют свойство зеленеть при хранении на свету, что является индикатором повышенного содержания соланина в них. ','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(11,'tt','','','','','','','морковь','двулетнее растение (редко одно- или многолетнее), в первый год жизни образует розетку листьев и корнеплод[4], во второй год жизни — семенной куст и семена.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(12,'tt','','','','','','','персик','растение из семейства Розовые, подрода Миндаль. Весьма близко к миндалевому дереву, от которого отличается только плодами.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(13,'tt','','','','','','','арбуз','однолетнее травянистое растение, вид рода Арбуз (Citrullus) семейства Тыквенные (Cucurbitaceae).','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(14,'tt','','','','','','','дыня','растение семейства Тыквенные (Cucurbitaceae), вид рода Огурец (Cucumis), бахчевая культура.\n\nРодиной дыни считается Средняя Азия и Малая Азия. Дыня тепло- и светолюбивое растение, устойчивое к засолению почвы и засухе, плохо переносит повышенную влажность воздуха. Плод дыни — тыквина — имеет шаровидную или цилиндрическую форму, зелёной, жёлтой, коричневой или белой окраски, как правило с зелёными полосками. Период вызревания от двух до шести месяцев.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(15,'tt','','','','','','','слива','род растений семейства Розовые (Rosaceae). Включает около 250 видов, распространённых, главным образом, в северных умеренных областях земного шара. Многие представители рода — широко известные плодовые культуры.\n\nМногие виды, сейчас включаемые в род Prunus, ранее выделялись в самостоятельные роды, в связи с чем они имеют русские названия, не связанные с русским названием рода: вишня, персик, абрикос, миндаль, черешня, черёмуха обыкновенная и другие.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(16,'tt','','','','','','','смородина','род растений из семейства Крыжовниковые (Grossulariaceae) порядка двудольных цветковых растений Камнеломкоцветные.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(17,'tt','','','','','','','помидор','однолетнее или многолетнее травянистое растение, вид рода Паслён (Solanum)[2] семейства Паслёновые. Возделывается как овощная культура. Плод томата (ягода) в разговорной речи называется помидо́р.','2015-11-08 18:03:03','2015-11-08 18:03:03','edible'),(18,'tt','','','','','','','стакан','обычно стеклянный сосуд, близкий по форме к цилиндру или усечённому конусу, без ручки. Применяется для холодных и горячих напитков. В последнем случае часто используется подстаканник. Форма стакана обычно близка к цилиндру или к усечённому конусу, однако встречаются стаканы более сложной формы. Основным отличием стакана от других типов посуды является отсутствие ручки. Стаканы также бывают гранёными.','2015-11-08 18:03:03','2015-11-08 18:03:03','inedible'),(19,'tt','','','','','','','лампа',' искусственный источник света, в котором свет испускает тело накала, нагреваемое электрическим током до высокой температуры. В качестве тела накала чаще всего используется спираль из тугоплавкого металла (чаще всего — вольфрама), либо угольная нить. Чтобы исключить окисление тела накала при контакте с воздухом, его помещают в вакуумированную колбу, либо колбу, заполненную инертными газами или парами галогенов.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(20,'tt','','','','','','','растения','биологическое царство, одна из основных групп многоклеточных организмов, включающая в себя в том числе мхи, папоротники, хвощи, плауны, голосеменные и цветковые растения. Нередко к растениям относят также все водоросли или некоторые их группы. Растения (в первую очередь, цветковые) представлены многочисленными жизненными формами — среди них есть деревья, кустарники, травы и др. Растения являются объектом исследования науки ботаники.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(21,'tt','','','','','','','Фрукт','Фрукт (лат. fructus — плод) — сочный съедобный плод дерева или кустарника[1]. Фрукты являются важной составляющей пищи человека и многих животных.\n\nВ древнерусском языке слова «фрукт» не существовало, оно появляется лишь в 1705 году, это заимствование через польск. fruct из лат. fructus; любые плоды назывались овощами или овоштами.\n\nВ русском языке «фрукт» — термин не ботанический, а бытовой и хозяйственный. В хозяйстве съедобные растения и съедобные части растений делят на фрукты, овощи, орехи, зерновые культуры и т. д. По традиционной классификации, фрукты — сочные плоды деревьев (груша, слива), ягоды — сочные плоды травянистых растений (земляника) или кустарников (малина, слива), овощи — съедобные корни растений.\n\nВ ботанике на русском языке вместо слова «фрукт» используется термин «плод», обозначающий любой орган растений, содержащий семена, образовавшийся из завязи цветка, независимо от съедобности. Среди плодов нередко выделяют следующие разновидности:\n\n    Плоды из сочной мякоти с семенами (огурцы, апельсины, дыни, яблоки)\n    Плоды из сочной мякоти с одной крупной центральной косточкой (черешня, слива, персики)\n    Сухие плоды (орехи, бобы, горох)\n\nВ некоторых языках «фрукт» и «плод» обозначают одним и тем же словом.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(22,'tt','','','','','','','минерал',' однородное природное твёрдое тело, находящееся или бывшее в кристаллическом состоянии. Минералы являются составной частью горных пород (породообразующие минералы), руд, метеоритов.\n\nТермин минерал используют для обозначения минеральных индивида, вида и разновидности. Минерал как минеральный вид — это природное химическое соединение, имеющее определённый химический состав и кристаллическую структуру. Если различия в химическом составе при структурной идентичности не очень велики, то по окраске, морфологическим или другим особенностям выделяют минеральные разновидности - например горный хрусталь, аметист, цитрин, халцедон являются разновидностями кварца. Минеральные индивиды - минеральные тела, между которыми имеются поверхности раздела, например, кристаллы и зёрна','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(23,'tt','','','','','','','мебель','совокупность передвижных или встроенных изделий для обстановки жилых и общественных помещений и различных зон пребывания человека.\n\nПредназначается для хранения и экспонирования различных предметов, сидения, лежания, приготовления пищи, выполнения письменных и других работ, разделения помещения на отдельные зоны. К мебели относятся столы, стулья и табуреты, кровати, кресла и диваны, шкафы различных типов и назначений, полки и некоторые другие виды (см. Список видов мебели).\n\nМебель может выпускаться как отдельным мебельным изделием, так и в составе набора или гарнитура.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(24,'tt','','','','','','','Устройство','Рукотворный объект (прибор, механизм, конструкция, установка) со сложной внутренней структурой, созданный для выполнения определённых функций, обычно в области техники.\nОбозначение действия от глагола «устроить» (употребляется только в единственном числе) («устройство на работу»), также в составе сложных слов и выражений (землеустройство, трудоустройство, (об)устройство парка).\nСоотношение частей, расположение, описание внутренней структуры объекта, его частей и их взаимосвязей (например: «внутреннее устройство электромотора оказалось на удивление простым», «устройство автомобиля для „чайников“») .','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(25,'tt','','','','','','','Инструмент','предмет, устройство, механизм, машина или алгоритм, используемые для воздействия на объект: его изменения или измерения в целях достижения полезного эффекта. В основе конструкции и правил использования инструмента лежит знание законов материального мира, приложенных к технологии производства. Сложный инструмент заключает в себе идею нескольких элементарных.\n\nВ широком смысле — средство воздействия на объект, преобразования и создания объекта. Но орудие, приспособление, не вспомогательный материал: при стирке белья стиральная доска — инструмент, а стиральный порошок — нет; при шитье игла — инструмент, а нить — нет. Один и тот же предмет может проявлять себя и как инструмент, и как вспомогательный материал. Зубная нить — инструмент, а нить при шитье — вспомогательный материал.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(26,'tt','','','','','','','звук',' физическое явление, представляющее собой распространение в виде упругих волн механических колебаний в твёрдой, жидкой или газообразной среде. В узком смысле под звуком имеют в виду эти колебания, рассматриваемые в связи с тем, как они воспринимаются органами чувств животных и человека.\n\nКак и любая волна, звук характеризуется амплитудой и спектром частот. Обычный человек способен слышать звуковые колебания в диапазоне частот от 16—20 Гц до 15—20 кГц. Звук ниже диапазона слышимости человека называют инфразвуком; выше: до 1 ГГц, — ультразвуком, от 1 ГГц — гиперзвуком. Громкость звука сложным образом зависит от эффективного звукового давления, частоты и формы колебаний, а высота звука — не только от частоты, но и от величины звукового давления.\n\nСреди слышимых звуков следует особо выделить фонетические, речевые звуки и фонемы (из которых состоит устная речь) и музыкальные звуки (из которых состоит музыка). Музыкальные звуки содержат не один, а несколько тонов, а иногда и шумовые компоненты в широком диапазоне частот.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(27,'tt','','','','','','','Видео','электронная технология формирования, записи, обработки, передачи, хранения и воспроизведения сигналов изображения, основанная на принципах телевидения, а также аудиовизуальное произведение, записанное на физическом носителе (видеокассете, видеодиске и т. п.).','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(28,'tt','','','','','','','Видеозапись','электронная технология записи визуальной информации, представленной в форме видеосигнала или цифрового потока видеоданных, на физический носитель с целью сохранения этой информации и возможности последующего её воспроизведения и отображения на устройстве вывода (монитора, экрана или дисплея). Результатом видеозаписи является видеограмма или видеофонограмма','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(29,'tt','','','','','','','Компьютер','устройство или система, способное выполнять заданную, чётко определённую изменяемую последовательность операций. Это чаще всего операции численных расчётов и манипулирования данными, однако сюда относятся и операции ввода-вывода. Описание последовательности операций называется программой. комплекс технических средств, где основные функциональные элементы (логические, запоминающие, индикационные и др.) выполнены на электронных элементах, предназначенных для автоматической обработки информации в процессе решения вычислительных и информационных задач.\n\nЭВМ используется как один из способов реализации компьютера. В настоящее время термин ЭВМ, как относящийся больше к вопросам конкретной физической реализации компьютера, почти вытеснен из бытового употребления и в основном используется инженерами цифровой электроники, как правовой термин в юридических документах, а также в историческом смысле — для обозначения компьютерной техники 1940—1980-х годов и больших вычислительных устройств, в отличие от персональных.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(30,'tt','','','','','','','одежда','совокупность швейных изделий (из ткани, вязаного полотна, кожи и меха), надеваемых человеком с целью обезопасить своё тело от негативного влияния окружающей среды (погодных условий, насекомых, токсических веществ и другое); одежда выполняет эстетические функции — создаёт образ (имидж) человека, что позволяет судить о его социальной роли. Дополняется украшениями, аксессуарами, причёской и макияжем. Различают два типа одежда: плечевую и поясную, в зависимости от того, какой участок тела человека является опорным. В зависимости от времени года и климатических зон, одежда делится на виды: летняя, зимняя, демисезонная и всесезонная. По половозростным признакам одежду делят на подгруппы: мужская, женская и детская. Детская делится на: одежда для новорожденных, ясельных детей, дошкольная, младшешкольная, старшешкольная и подростковая группа.\n\n','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(31,'tt','','','','','','','пища','то, что едят, чем питаются— любое вещество, пригодное для еды и питья живым организмам для пополнения запасов энергии и необходимых ингредиентов для нормального течения химических реакций обмена веществ: белков, жиров, углеводов, витаминов, минералов и микроэлементов. Питательные вещества попадают в живой организм, где усваиваются клетками с целью выработки и накопления энергии, поддержания жизнедеятельности, а также обеспечения ростовых процессов и созревания. Обычно пища делится по происхождению на растительную и животную. В отношении питания одомашненных животных распространено и употребимо понятие корм. Область человеческой деятельности, связанная с приготовлением пищи, называется кулинария (кухонное ремесло).\n\nОсновное назначение пищи — быть источником энергии, возобновляемых материалов (например, вода) и «строительного материала» для организма, однако, немаловажным в питании человека является и фактор получения удовольствия (удовлетворение голода) от еды.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(32,'tt','','','','','','','белок',' высокомолекулярные органические вещества, состоящие из соединённых в цепочку пептидной связью альфа-аминокислот. В живых организмах аминокислотный состав белков определяется генетическим кодом, при синтезе в большинстве случаев используется 20 стандартных аминокислот. Множество их комбинаций дают большое разнообразие свойств молекул белков. Кроме того, аминокислоты в составе белка часто подвергаются посттрансляционным модификациям, которые могут возникать и до того, как белок начинает выполнять свою функцию, и во время его «работы» в клетке. Часто в живых организмах несколько молекул белков образуют сложные комплексы, например, фотосинтетический комплекс.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(33,'tt','','','','','','','углеводы','весьма обширный класс органических соединений, среди них встречаются вещества с сильно различающимися свойствами. Это позволяет углеводам выполнять разнообразные функции в живых организмах. Соединения этого класса составляют около 80 % сухой массы растений и 2—3 % массы животных. Организмы животных не способны самостоятельно синтезировать углеводы из неорганических веществ. Они получают их из растений с пищей и используют в качестве главного источника энергии, получаемой в процессе окисления. Таким образом, в суточном рационе человека и животных преобладают углеводы. Травоядные получают крахмал, клетчатку, сахарозу. Хищники получают гликоген с мясом. Для человека главными источниками углеводов из пищи являются: хлеб, картофель, макароны, крупы, сладости. Чистым углеводом является сахар. Мёд, в зависимости от своего происхождения, содержит 70—80 % глюкозы и фруктозы.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(34,'tt','','','','','','','жиры','Жиры́, или с химической точки зрения триглицери́ды — природные органические соединения, полные сложные эфиры глицерина и одноосновных жирных кислот (входят в класс липидов). Наряду с углеводами и белками, жиры являются одним из основных источников энергии для млекопитающих, одним из главных компонентов питания. Эмульгирование жиров в кишечнике (необходимое условие их всасывания) осуществляется при участии солей жёлчных кислот. Энергетическая ценность жиров примерно в 2 раза выше, чем углеводов, при условии их биологической доступности и здорового усвоения организмом. В живых организмах жиры (липиды) выполняют важные структурные, энергетические и другие жизненноважные функции в составе мембранных образований клетки и в субклеточных органеллах. Жидкие жиры растительного происхождения обычно называют маслами. Кроме того, в кулинарии жир животного происхождения (полученный из молока животных) так же называют сливочное масло. Также в пищевой промышленности твёрдые жиры, полученные в результате трансформации (гидрирования или гидрогенизации) растительных масел называют саломасом, маргарином, комбинированным жиром или спредом.\n\nВ растениях жиры содержатся в сравнительно небольших количествах, за исключением семян масличных растений, в которых содержание жиров может быть более 50 %. Насыщенные жиры расщепляются в организме на 25—30 %, а ненасыщенные жиры расщепляются полностью.\n\nЖивотные жиры чаще всего содержат стеариновую и пальмитиновую кислоты, ненасыщенные жирные кислоты представлены в основном олеиновой, линолевой и линоленовой кислотами. Физико-химические и химические свойства данной категории жиров в значительной мере определяются соотношением входящих в их состав насыщенных и ненасыщенных жирных кислот.','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(35,'tt','','','','','','','Пищевые продукты','\n    злаки (пшеница, рожь, ячмень, рис и др.) и похожие на них: гречка, кукуруза, киноа, амарант\n        орехи: лещина, фундук, грецкий орех, кокос, миндаль и др.\n        бобовые: горох, фасоль, бобы, соя, чечевица, турецкий горох (нут), арахис\n        масличные: подсолнух, лён, кунжут\n    фрукты\n        цитрусовые\n        ягоды\n    овощи:\n        плодовые (баклажаны), в том числе бахчевые (тыква), (кабачки)\n        корнеплоды (свекла, морковь, репа) и клубневые (картофель)\n        листовые (шпинат, капуста) и цветковые (артишок, брокколи)\n        (душистая) зелень: петрушка, кинза, укроп\n        луковичные: лук, чеснок\n        стеблевые (спаржа)\n    травы и пряности\n    соки деревьев (березовый сок, кленовый сироп)\n\n    Мясо животных (первые две группы делятся также на мясо домашних животных и дичь)\n        млекопитающих: говядина, свинина, баранина, крольчатина и проч., а также субпродукты\n        птиц: курятина, утятина, гусятина, индюшатина, страусятина, голубятина и др.\n        пресмыкающихся и земноводных: лягушки, змеи, черепахи и др.\n    Молоко и молочные продукты, полученные от жизнедеятельности (без умерщвления) животных: кефир, сливки, творог, сыр, масло, сметана и др.\n    Яйца и икра: яйца птиц, красная и чёрная рыбья икра, белая икра (улиток) и др.\n    Рыба\n    Моллюски (устрицы, кальмары, улитки и др.) и ракообразные (раки, креветки, крабы, лангусты и др.) — те из них, что живут в морях, называются морепродуктами\n    Насекомые и паукообразные: саранча, тарантулы, кузнечики и проч.\n    Грибы\n    Дрожжи\n    Водоросли\n    Продукты, полученные с помощью растений или животных: желатин, сахар, мёд, уксус.\n\n    Из злаков:\n        Мука и мучные изделия, в том числе макароны, хлеб\n        крупы, из которых варят каши\n\nИз других растений: шоколад, кофе, растительное масло, томатная паста и др.\n\n    Из молока — молочные продукты:\n        Молоко\n        Сыр и творог\n        Сливочное масло, сливки\n        Сметана\n        Кисломолочные продукты\n        Мороженое\n    Из мяса: фарш, филе, колбасы, копчености, сало, жир.\n    Из сахара (и фруктов): варенье, сироп, джем, конфеты и другие.\n\nПищевые изделия обычно пригодны для продолжительного хранения. Это не относится к необработанным продуктам, срок годности которых, как правило, ограничен.\n\n','2015-11-08 18:03:04','2015-11-08 18:03:04','edible'),(36,'tt','','','','','','','Пластмассы','Основные механические характеристики пластмасс те же, что и для металлов.\nПластмассы характеризуются малой плотностью (0,85—1,8 г/см³), чрезвычайно низкими электрической и тепловой проводимостями, не очень большой механической прочностью. При нагревании (часто с предварительным размягчением) они разлагаются. Не чувствительны к влажности, устойчивы к действию сильных кислот и оснований, отношение к органическим растворителям различное (в зависимости от химической природы полимера). Физиологически почти безвредны. Свойства пластмасс можно модифицировать методами сополимеризации или стереоспецифической полимеризации, путём сочетания различных пластмасс друг с другом или с другими материалами, такими как стеклянное волокно, текстильная ткань, введением наполнителей и красителей, пластификаторов, тепло- и светостабилизаторов, облучения и др., а также варьированием сырья, например использование соответствующих полиолов и диизоцианатов при получении полиуретанов.\n\nТвёрдость пластмасс определяется по Бринеллю при нагрузках 50—250 кгс на шарик диаметром 5 мм.\n\nТеплостойкость по Мартенсу — температура, при которой пластмассовый брусок с размерами 120 × 15 × 10 мм, изгибаемый при постоянном моменте, создающем наибольшее напряжение изгиба на гранях 120 × 15 мм, равное 50 кгс/см², разрушится или изогнётся так, что укреплённый на конце образца рычаг длиной 210 мм переместится на 6 мм.\n\nТеплостойкость по Вика — температура, при которой цилиндрический стержень диаметром 1,13 мм под действием груза массой 5 кг (для мягких пластмасс 1 кг) углубится в пластмассу на 1 мм.\n\nТемпература хрупкости (морозостойкость) — температура, при которой пластичный или эластичный материал при ударе может разрушиться хрупко.\n\nДля придания особых свойств пластмассе в неё добавляют пластификаторы (силикон, дибутилфталат, ПЭГ и т. п.), антипирены (дифенилбутансульфокислота), антиоксиданты (трифенилфосфит, непредельные углеводороды).','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(37,'tt','','','','','','','Строительные материалы','\n    каменные природные строительные материалы и изделия из них\n    вяжущие материалы неорганические и органические\n    лесные материалы и изделия из них\n    металлические изделия\n\nВ зависимости от назначения, условий строительства и эксплуатации зданий и сооружений подбираются соответствующие строительные материалы, которые обладают определёнными качествами и защитными свойствами от воздействия на них различной внешней среды. Учитывая эти особенности, любой строительный материал должен обладать определёнными строительно-техническими свойствами. Например, материал для наружных стен зданий должен обладать наименьшей теплопроводностью при достаточной прочности, чтобы защищать помещение от потерь тепла; материал сооружения гидромелиоративного назначения — водонепроницаемостью и стойкостью к попеременному увлажнению и высыханию; материал для покрытия дорог (асфальт, бетон) должен иметь достаточную прочность и малую истираемость, чтобы выдержать нагрузки от транспорта. По применению классифицируются на две основные категории. К первой категории относят — конструкционные: кирпич, бетон, цемент, лесоматериалы и др. Их применяют при возведении различных элементов зданий (стен, перекрытий, покрытий, полов). Ко второй категории — специального назначения: гидроизоляционные, теплоизоляционные, акустические, отделочные и др. Наряду со «старыми» материалами, такими как древесина, камень и кирпич, с началом промышленной революции появились новые стройматериалы — бетон, сталь, стекло и пластмасса. В настоящее время широко используют предварительно напряжённый железобетон и металлопластик.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(38,'tt','','','','','','','Автомобиль','Автомобиль (от др.-греч. — движущийся), автотранспортное средство, в совокупности авто-техника, автотранспорт — моторное безрельсовое дорожное транспортное средство минимум с 3 колёсами.\n\nОсновное функциональное назначение автомобиля заключается в совершении транспортной работы. Автомобильный транспорт в индустриально развитых странах занимает ведущее место по сравнению с другими видами транспорта по объему перевозок пассажиров и грузов.\n\nСовременный автомобиль состоит из 15—20 тысяч деталей, из которых 150—300 являются наиболее важными и требующих наибольших затрат в эксплуатации.\n\nТермин включает легковой автомобиль, грузовой автомобиль, автобус, троллейбус, бронетранспортёр, но не включает сельскохозяйственный трактор и мотоцикл.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(39,'tt','','','','','','','Автомобиль','Механическое транспортное средство, используемое обычно для перевозки по дорогам людей или грузов или для буксировки по дорогам транспортных средств, используемых для перевозки людей или грузов. Этот термин охватывает троллейбусы, то есть нерельсовые транспортные средства, соединённые с электрическим проводом; он не охватывает такие транспортные средства, как сельскохозяйственные тракторы, использование которых для перевозки людей или грузов является лишь вспомогательной функцией.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(40,'tt','','','','','','','Спортивный инвентарь','Спортивный инвентарь — устройство, приспособление узкоспециального назначения, используемое при занятии различными видами спорта. Спортивный инвентарь — термин, обобщающий использование различных спортивных снарядов, приспособлений, устройств, механических и электронных средств, использование которых предусмотрено правилами соревнований по отдельным видам спорта.\n\nСпортивный снаряд — особый предмет, используемый для какого либо вида спорт и имеющий строго определённые характеристики.\n\nБольшинство современных видов спорта предполагают использование спортивных снарядов (мяч, штанга, диск, копьё, гиря, булава, лента, брусья, бревно и другие) и/или специальных приспособлений (лыжи, коньки, шлем, клюшка, очки, велосипед, парашют, ледоруб и т.д.), являющихся неотъемлемой частью вида спорта, способствующих достижению наивысших достижений в том или ином виде спорта и/или обеспечивающих безопасность.\n\nСпортивная индустрия при производстве спортивного инвентаря широко использует новейшие достижения научно-технического прогресса. Благодаря научно-техническому прогрессу, внедрению его достижений в спорте, может возникнуть ситуация, когда спортсмен побеждает не благодаря своим физическим и интеллектуальным способностям или возможностям, а благодаря тому, что у него есть инвентарь, которого нет у соперников. Это нарушает принцип честного спортивного соревнования. Поэтому очень часто спортивное сообщество, спортивные федерации устанавливают определенные ограничения на использование тех или иных достижений с целью создания равных возможностей для участников спортивных соревнований.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(41,'tt','','','','','','','Стол','Деревянный с четыремя ножками. Форма прямоугольная. Цвет светлый. Стоит на полу.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(42,'tt','','','','','','','Стул','Деревянный с четыремя ножками. Форма прямоугольная. Цвет светлый. Стоит на полу.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(43,'tt','','','','','','','Баскетбольный мяч','Круглый, оранжевый с полосками черного цвета. Используют для игры. Весит примерно 300 грамм.','2015-11-08 18:03:04','2015-11-08 18:03:04','inedible'),(60,'ab534111-85d8-4618-8d06-c668938814f1','','','','','','','','Сладкая, нежно сливочного вкуса. Производится из молока с добавлением сахара','2015-11-13 18:34:06','2015-11-13 18:34:06','edible'),(62,'0e90eb64-f435-4e64-bef2-f4247a838661','','','','','','','помидор','Круглый,Красный, с кожицей. Есть семечки.  Растет в огороде','2015-11-13 19:21:48','2015-11-13 19:21:48','edible'),(64,'0a6a5a1d-8477-41f3-b259-bc0e386791f6','','','','','','','персик','Круглый, оранжевый. Бархатистая кожица. Имеет большую косточку','2015-11-13 19:23:30','2015-11-13 19:23:30','edible'),(65,'8b70a33d-a8e7-4707-af1b-8300c941b28b','','','','','','','автомобиль','Из металла. Обычно имеет четыре колеса. Используется для перевозки людей и грузов по дорогам. Потребляет бензин или солярку. ','2015-11-14 00:13:04','2015-11-14 00:13:04','inedible');
